        <div >
            <h2>Payment method</h2>
            <h2>{client.Name}</h2>
            <div class="formcontainer">
                <form>
                    <label> Card no:</label>

                    <input type="text" ></input>

                    <div>
                        <label> Cv code:</label>
                        <input type="text"></input>
                    </div>
